macro.dbtvault.default__prefix.macro_sql:
{%- macro default__prefix(columns=none, prefix_str=none, alias_target='source') -%}

    {%- if columns and prefix_str -%}

        {%- for col in columns -%}

            {%- if col is mapping -%}

                {%- if alias_target == 'source' -%}

                    {{- dbtvault.prefix([col['source_column']], prefix_str) -}}

                {%- elif alias_target == 'target' -%}

                    {{- dbtvault.prefix([col['alias']], prefix_str) -}}

                {%- else -%}

                    {{- dbtvault.prefix([col['source_column']], prefix_str) -}}

                {%- endif -%}

                {%- if not loop.last -%} , {% endif %}

            {%- else -%}

                {%- if col is iterable and col is not string -%}

                    {{- dbtvault.prefix(col, prefix_str) -}}

                {%- elif col is not none -%}

                    {{- prefix_str}}.{{col.strip() -}}
                {% else %}

                    {%- if execute -%}
                        {{- exceptions.raise_compiler_error("Unexpected or missing configuration for '" ~ this ~ "' Unable to prefix columns.") -}}
                    {%- endif -%}
                {%- endif -%}

                {{- ', ' if not loop.last -}}

            {%- endif -%}

        {%- endfor -%}

    {%- else -%}

        {%- if execute -%}
            {{- exceptions.raise_compiler_error("Invalid parameters provided to prefix macro. Expected: (columns [list/string], prefix_str [string]) got: (" ~ columns ~ ", " ~ prefix_str ~ ")") -}}
        {%- endif -%}
    {%- endif -%}

{%- endmacro -%}

macro.dbtvault.sqlserver__get_query_resu.macro_sql:
{% macro sqlserver__get_query_results_as_dict(query) %}

    {%- call statement('get_query_results', fetch_result=True,auto_begin=false) -%}

        {{ query }}

    {%- endcall -%}

    {% set sql_results={} %}

    {%- if execute -%}
        {% set sql_results_table = load_result('get_query_results').table.columns %}
        {% for column_name, column in sql_results_table.items() %}
            {# Column names in upper case for consistency #}
            {% do sql_results.update({column_name.upper(): column.values()}) %}
        {% endfor %}
    {%- endif -%}

    {{ return(sql_results) }}

{% endmacro %}
